import React from 'react'
import data from './data'
import './home.css'
import Flippy, { FrontSide, BackSide } from '.react-flippy';
export default function Homepage() {
  return (
    <>
     <Flippy
    flipOnHover={false} // default false
    flipOnClick={true} // default false
    flipDirection="horizontal" // horizontal or vertical
    ref={(r) => this.flippy = r} // to use toggle method like this.flippy.toggle()
    // if you pass isFlipped prop component will be controlled component.
    // and other props, which will go to div
    style={{ width: '200px', height: '200px' }} /// these are optional style, it is not necessary
  >
    <FrontSide
      style={{
        backgroundColor: '#41669d',
      }}
    >
      RICK
    </FrontSide>
    <BackSide
      style={{ backgroundColor: '#175852'}}>
      ROCKS
    </BackSide>
  </Flippy>
<div className="row row-cols-1 row-cols-md-3 g-4">
  <div className="col">
    <div style={{width: "15rem",height: '20rem'}}>
    {
      data.map((data)=>{
        const{image}=data;
      return <img src={image}  alt="..." className="card-img-top"/>
      })
    }
    </div>
  </div>
</div>
    <div className="card" id='card' style={{width: "15rem",height: '20rem'}}>
      <div className="card-body">
    <h5 className="card-title">WHEN YOU SEE YOUR CRUSH LOOK AT YOU</h5>
      </div>
    </div> 
    </>
  )
  }
